    position: 'relative',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-start',
    width: '100px',
    height: '40px',
    border: 'none',
    padding: '0px 20px',
    backgroundColor: 'rgb(168, 38, 255)',
    color: 'white',
    fontWeight: '500',
    cursor: 'pointer',
    borderRadius: '10px',
    boxShadow: '5px 5px 0px rgb(140, 32, 212)',
    transitionDuration: '.3s',
  };

  const svgStyle = {
    width: '13px',
    position: 'absolute',
    right: '0',
    marginRight: '20px',
    fill: 'white',
    transitionDuration: '.3s',
  };
  return (
    <button style={btnStyle} onClick={onClick}>
      Editar 
